import React from 'react';
import { Link } from 'react-router-dom';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faSignOutAlt } from '@fortawesome/free-solid-svg-icons';
import './Sidebar.css';  // Import the CSS file

const Sidebar = () => {
  return (
    <div className="sidebar-container">
      <nav>
        <Link to="/" className="sidebar-link">Dashboard</Link>
        <Link to="/products" className="sidebar-link">Products</Link>
        <Link to="/brands" className="sidebar-link">Brands</Link>
        <Link to="/categories" className="sidebar-link">Categories</Link>
        <Link to="/orders" className="sidebar-link">Orders</Link>
        <Link to="/coupons" className="sidebar-link">Coupons</Link>
        <Link to="/settings" className="sidebar-link">Settings</Link>
        <Link to="/signup" className="sidebar-link">Sign Up</Link>
      </nav>
      <div className="sidebar-footer">
        <Link to="/logout" className="sidebar-link logout-link">
          <FontAwesomeIcon icon={faSignOutAlt} className="mr-2" /> Logout
        </Link>
      </div>
    </div>
  );
};

export default Sidebar;
